#SeguridadCiudadana | Tras un ataque a una patrulla y personal de la 
@FUERZARMADASV, muere un terrorista y dos más fueron detenidos por la @PNCSV en Corinto, Morazán.

La captura fue en un campamento clandestino y se incautaron dos armas de fuego. https://t.co/VhwYQWGkxV

